--
-- Table structure for table `used_cars`
--

DROP TABLE IF EXISTS `used_cars`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `used_cars` (
  `used_car_id` bigint unsigned NOT NULL AUTO_INCREMENT COMMENT '주식별자(PK)',
  `car_spec_id` bigint unsigned NOT NULL COMMENT 'car_specs 참조 식별자(FK)',
  `price` int NOT NULL COMMENT '등록된 가격과 리스인 경우에 실질가격(원): 인수비용+(월 리스료 * 남은 리스개월)-승계지원금',
  `listing_url` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '중고차 매매 사이트 링크',
  `is_lease` tinyint NOT NULL DEFAULT '0' COMMENT '0=일반매물, 1=리스/렌트/할부승계 포함',
  `mileage_km` int NOT NULL COMMENT '주행 거리 (Km)',
  `color_name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '차량의 색상',
  `car_age_months` int NOT NULL COMMENT '차량 연식(개월): 서비스 기준월 - 최초등록월',
  PRIMARY KEY (`used_car_id`),
  UNIQUE KEY `ux_used_cars_listing_url` (`listing_url`),
  KEY `idx_used_cars_car_spec_id` (`car_spec_id`),
  CONSTRAINT `fk_used_cars_car_specs` FOREIGN KEY (`car_spec_id`) REFERENCES `car_specs` (`car_spec_id`) ON DELETE RESTRICT ON UPDATE CASCADE,
  CONSTRAINT `chk_used_cars_is_lease` CHECK ((`is_lease` in (0,1)))
) ENGINE=InnoDB AUTO_INCREMENT=581 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

